import React from 'react';

class CheckBox extends React.Component {

    checkStatus = () => {
        this.props.checkedChannelType.map((element) =>{
            console.log(element);
            if(element.type === props.label)
                return element.value;
        });
    }

    render(){
        return (
            <div>   
                <input type="checkbox" id={this.props.itemType} name={this.props.label} onChange = {this.props.onChangeChannelType}
                checked = {this.checkStatus}/>
                <label>{this.props.label}</label>
            </div>
        );
    }
}

export default CheckBox;
